import React from 'react';
import email from './assets/mail-bulk-solid.svg';
import {
  ICON_ALT,
  MAIN_IMAGE_ALT,
  WEBSITE_EMAIL,
  WEBSITE_EMAIL_LINK,
  WEBSITE_TITLE_A,
  WEBSITE_TITLE_B,
} from './constants';
import image from './assets/rachel-in-studio.jpg';

function App() {
  return (
    <div className="flex justify-center items-center h-screen w-screen flex-row bg-red-900">
      <header className="flex flex-col gap-y-8 items-center relative z-10">
        <div className="flex flex-col">
          <span className="font-pathway uppercase font-black text-gray-100 opacity-80 text-6xl italic pr-10">
            {WEBSITE_TITLE_A}
          </span>
          <span className="font-pathway uppercase font-black text-gray-100 opacity-80 text-6xl italic pl-10">
            {WEBSITE_TITLE_B}
          </span>
        </div>
        <div className="flex gap-x-2 text-center rounded-full bg-gray-100 bg-opacity-80 p-3">
          <img src={email} alt={ICON_ALT} className="w-8 h-8" />
          <a href={WEBSITE_EMAIL_LINK} className="text-xl font-arvo">
            {WEBSITE_EMAIL}
          </a>
        </div>
      </header>
      <img
        src={image}
        alt={MAIN_IMAGE_ALT}
        className="h-screen rotate-12 shadow-2xl"
      />
    </div>
  );
}

export default App;
